--
-- Eventos
--
CREATE DEFINER=`root`@`localhost` EVENT `ELIMINAR PREINSCRIPTOS DESPUES DE UN MES` ON SCHEDULE EVERY 1 DAY STARTS '2016-05-25 23:59:59' ON COMPLETION NOT PRESERVE ENABLE DO DELETE tparticipante,tusuario FROM tparticipante JOIN tusuario ON tparticipante.cedulapar=tusuario.idusuario
WHERE tparticipante.preinscrito='1' AND DATEDIFF(NOW(),tparticipante.fecha_preinscripcion)>=(SELECT cant_dias_preinscrito FROM tsistema)$$

